import React, { Component } from "react";
class SignLog extends Component {
  render() {
    return (
      <div id="containerSignLog">
        <div id="signLog">
          <div id="signUp">
            <p>New User? Sign Up.</p>
            <div className="signLogInputs"><input placeholder="Enter your email" type="email" id="newEmail"></input>
            <input placeholder="Enter new password" type="password"id="newPassword"></input>
            <input placeholder="Enter your number" type="number" id="newPhone"></input>
            <button id="newSubmit">Sign Up</button></div>
          </div>
          <div id="logIn">
            <p>Already registered. Log In.</p>
            <div><input placeholder="Enter email or phone number" id="newEmailPhone"></input>
            <input placeholder="Enter your password" type="password" id="oldPassword"></input>
            <button id="OldSubmit">Log In</button></div>
          </div>
        </div>
      </div>
    );
  }
}

export default SignLog;
